document.write( '    &amp;.vjs-has-started.vjs-paused .vjs-big-play-button{\n' );
document.write( '        display: block;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    /* Hide on mobile devices. Remove when we stop using native controls\n' );
document.write( '    by default on mobile  */\n' );
document.write( '    &amp;.vjs-using-native-controls .vjs-big-play-button {\n' );
document.write( '        display: none;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    &amp;:hover .vjs-big-play-button,\n' );
document.write( '    .vjs-big-play-button:focus {\n' );
document.write( '        outline: 0;\n' );
document.write( '        opacity: 1;\n' );
document.write( '\n' );
document.write( '        /* transition */\n' );
document.write( '        -webkit-transition: all 0s;\n' );
document.write( '        -moz-transition: all 0s;\n' );
document.write( '        -o-transition: all 0s;\n' );
document.write( '        transition: all 0s;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    /* Menu Buttons (Captions/Subtitles/etc.)\n' );
document.write( '    --------------------------------------------------------------------------------\n' );
document.write( '    */\n' );
document.write( '    .vjs-menu-button {\n' );
document.write( '        float: right;\n' );
document.write( '        cursor: pointer;\n' );
document.write( '        margin-right: 15px;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-menu {\n' );
document.write( '        display: none;\n' );
document.write( '        position: absolute;\n' );
document.write( '        bottom: 0;\n' );
document.write( '        left: 0em;\n' );
document.write( '        /* (Width of vjs-menu - width of button) / 2 */\n' );
document.write( '\n' );
document.write( '        width: 0;\n' );
document.write( '        height: 0;\n' );
document.write( '        margin-bottom: $player-controls-height;\n' );
document.write( '        border-left: 10px solid transparent;\n' );
document.write( '        border-right: 10px solid transparent;\n' );
document.write( '        border-top: 10px solid #000000;\n' );
document.write( '        /* Same width top as ul bottom */\n' );
document.write( '\n' );
document.write( '        border-top-color: #000000;\n' );
document.write( '        /* Same as ul background */\n' );
document.write( '\n' );
document.write( '    }\n' );
document.write( '    /* Button Pop-up Menu */\n' );
document.write( '    .vjs-menu-button .vjs-menu .vjs-menu-content {\n' );
document.write( '        display: block;\n' );
document.write( '        padding: 0;\n' );
document.write( '        margin: 0;\n' );
document.write( '        position: absolute;\n' );
document.write( '        width: 10em;\n' );
document.write( '        bottom: 10px;\n' );
document.write( '        /* Same bottom as vjs-menu border-top */\n' );
document.write( '\n' );
document.write( '        max-height: 15em;\n' );
document.write( '        overflow: auto;\n' );
document.write( '        left: -5em;\n' );
document.write( '        /* Width of menu - width of button / 2 */\n' );
document.write( '\n' );
document.write( '        /* background-color-with-alpha */\n' );
document.write( '        background-color: #07141e;\n' );
document.write( '        background-color: rgba(7, 20, 30, 0.7);\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-menu-button:hover .vjs-menu {\n' );
document.write( '        display: block;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-menu-button ul li {\n' );
document.write( '        list-style: none;\n' );
document.write( '        margin: 0;\n' );
document.write( '        padding: 0.3em 0 0.3em 0;\n' );
document.write( '        line-height: 1.4em;\n' );
document.write( '        font-size: 1.2em;\n' );
document.write( '        text-align: center;\n' );
document.write( '        text-transform: lowercase;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-menu-button ul li.vjs-selected {\n' );
document.write( '        background-color: #000;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-menu-button ul li:focus,\n' );
document.write( '    .vjs-menu-button ul li:hover,\n' );
document.write( '    .vjs-menu-button ul li.vjs-selected:focus,\n' );
document.write( '    .vjs-menu-button ul li.vjs-selected:hover {\n' );
document.write( '        outline: 0;\n' );
document.write( '        color: #111;\n' );
document.write( '        /* background-color-with-alpha */\n' );
document.write( '        background-color: #ffffff;\n' );
document.write( '        background-color: rgba(255, 255, 255, 0.75);\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-menu-button ul li.vjs-menu-title {\n' );
document.write( '        text-align: center;\n' );
document.write( '        text-transform: uppercase;\n' );
document.write( '        font-size: 1em;\n' );
document.write( '        line-height: 2em;\n' );
document.write( '        padding: 0;\n' );
document.write( '        margin: 0 0 0.3em 0;\n' );
document.write( '        font-weight: bold;\n' );
document.write( '        cursor: default;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    /* Subtitles Button */\n' );
document.write( '    .vjs-subtitles-button {\n' );
document.write( '        background: url(data:image/png;base64,) no-repeat center center;\n' );
document.write( '        margin-right: 15px;\n' );
document.write( '        height: $player-controls-height;\n' );
document.write( '        width: 21px;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    /* Hide disabled or unsupported controls */\n' );
document.write( '    .vjs-hidden {\n' );
document.write( '        display: none;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    .vjs-resolutions-button {\n' );
document.write( '        cursor: pointer;\n' );
document.write( '        background: url(data:image/png;base64,) no-repeat center center;\n' );
document.write( '        margin-right: 15px;\n' );
document.write( '        height: $player-controls-height;\n' );
document.write( '        width: 22px;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '    /* Resolutions Icon */\n' );
document.write( '   .vjs-resolutions-button .vjs-control-content {\n' );
document.write( '        content: \"\";\n' );
document.write( '        width: 17px;\n' );
document.write( '        height: 17px;\n' );
document.write( '    }\n' );
document.write( '\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '/* IE8 is flakey with fonts, and you have to change the actual content to force\n' );
document.write( 'fonts to show/hide properly.\n' );
document.write( '- \"9\" IE8 hack didn\'t work for this\n' );
document.write( '- Found in XP IE8 from http://modern.ie. Does not show up in \"IE8 mode\" in IE9\n' );
document.write( '*/\n' );
document.write( '@media screen {\n' );
document.write( '    .radium-player-skin.vjs-user-inactive.vjs-playing .vjs-control-bar :before {\n' );
document.write( '        content: \"\";\n' );
document.write( '    }\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '/* Loading Spinner\n' );
document.write( '--------------------------------------------------------------------------------\n' );
document.write( '*/\n' );
document.write( '.vjs-loading-spinner {\n' );
document.write( '    display: none;\n' );
document.write( '    position: absolute;\n' );
document.write( '    opacity: 0.75;\n' );
document.write( '    position:absolute;\n' );
document.write( '    top: 49%;\n' );
document.write( '    left: 45%;\n' );
document.write( '    width: 58px;\n' );
document.write( '    height: 58px;\n' );
document.write( '    margin: -30px 0 0; \n' );
document.write( '    border-width: 4px;\n' );
document.write( '    border-style: solid;\n' );
document.write( '    border-color: #FFF #FFF rgba(255, 255, 255, 0.5) rgba(255, 255, 255, 0.5);\n' );
document.write( '    opacity: .9;\n' );
document.write( '    border-radius: 50%;\n' );
document.write( '\n' );
document.write( '    /* animation */\n' );
document.write( '    -webkit-animation: spin 1.5s infinite linear;\n' );
document.write( '    -moz-animation: spin 1.5s infinite linear;\n' );
document.write( '    -o-animation: spin 1.5s infinite linear;\n' );
document.write( '    animation: spin 1.5s infinite linear;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '@-moz-keyframes spin {\n' );
document.write( '  0% {\n' );
document.write( '    -moz-transform: rotate(0deg);\n' );
document.write( '  }\n' );
document.write( '  100% {\n' );
document.write( '    -moz-transform: rotate(359deg);\n' );
document.write( '  }\n' );
document.write( '}\n' );
document.write( '@-webkit-keyframes spin {\n' );
document.write( '  0% {\n' );
document.write( '    -webkit-transform: rotate(0deg);\n' );
document.write( '  }\n' );
document.write( '  100% {\n' );
document.write( '    -webkit-transform: rotate(359deg);\n' );
document.write( '  }\n' );
document.write( '}\n' );
document.write( '@-o-keyframes spin {\n' );
document.write( '  0% {\n' );
document.write( '    -o-transform: rotate(0deg);\n' );
document.write( '  }\n' );
document.write( '  100% {\n' );
document.write( '    -o-transform: rotate(359deg);\n' );
document.write( '  }\n' );
document.write( '}\n' );
document.write( '@keyframes spin {\n' );
document.write( '  0% {\n' );
document.write( '    transform: rotate(0deg);\n' );
document.write( '  }\n' );
document.write( '  100% {\n' );
document.write( '    transform: rotate(359deg);\n' );
document.write( '  }\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '@keyframes videojsloading {\n' );
document.write( '  0% { background-position: 0 0; }\n' );
document.write( '  100% { background-position: 80px 0; }\n' );
document.write( '}\n' );
document.write( '@-webkit-keyframes videojsloading {\n' );
document.write( '  0% { background-position: 0 0; }\n' );
document.write( '  100% { background-position: 80px 0; }\n' );
document.write( '}\n' );
document.write( '@-moz-keyframes videojsloading {\n' );
document.write( '  0% { background-position: 0 0; }\n' );
document.write( '  100% { background-position: 80px 0; }\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '/*\n' );
document.write( 'REQUIRED STYLES (be careful overriding)\n' );
document.write( '================================================================================\n' );
document.write( 'When loading the player, the video tag is replaced with a DIV,\n' );
document.write( 'that will hold the video tag or object tag for other playback methods.\n' );
document.write( 'The div contains the video playback element (Flash or HTML5) and controls,\n' );
document.write( 'and sets the width and height of the video.\n' );
document.write( '\n' );
document.write( '** If you want to add some kind of border/padding (e.g. a frame), or special\n' );
document.write( 'positioning, use another containing element. Otherwise you risk messing up\n' );
document.write( 'control positioning and full window mode. **\n' );
document.write( '*/\n' );
document.write( '.video-js {\n' );
document.write( '  background-color: #000;\n' );
document.write( '  position: relative;\n' );
document.write( '  padding: 0;\n' );
document.write( '  /* Start with 10px for base font size so other dimensions can be em based and\n' );
document.write( '     easily calculable. */\n' );
document.write( '\n' );
document.write( '  font-size: 10px;\n' );
document.write( '  /* Allow poster to be vertially aligned. */\n' );
document.write( '\n' );
document.write( '  vertical-align: middle;\n' );
document.write( '  /*  display: table-cell; */\n' );
document.write( '  /*This works in Safari but not Firefox.*/\n' );
document.write( '\n' );
document.write( '  /* Provide some basic defaults for fonts */\n' );
document.write( '\n' );
document.write( '  font-weight: normal;\n' );
document.write( '  font-style: normal;\n' );
document.write( '  /* Avoiding helvetica: issue #376 */\n' );
document.write( '\n' );
document.write( '  font-family: Arial, sans-serif;\n' );
document.write( '  /* Turn off user selection (text highlighting) by default.\n' );
document.write( '     The majority of player components will not be text blocks.\n' );
document.write( '     Text areas will need to turn user selection back on. */\n' );
document.write( '\n' );
document.write( '  /* user-select */\n' );
document.write( '  -webkit-user-select: none;\n' );
document.write( '  -moz-user-select: none;\n' );
document.write( '  -ms-user-select: none;\n' );
document.write( '  user-select: none;\n' );
document.write( '}\n' );
document.write( '/* Playback technology elements expand to the width/height of the containing div\n' );
document.write( '    &lt;video&gt; or &lt;object&gt; */\n' );
document.write( '.video-js .vjs-tech {\n' );
document.write( '  position: absolute;\n' );
document.write( '  top: 0;\n' );
document.write( '  left: 0;\n' );
document.write( '  width: 100%;\n' );
document.write( '  height: 100%;\n' );
document.write( '}\n' );
document.write( '/* Fix for Firefox 9 fullscreen (only if it is enabled). Not needed when\n' );
document.write( '   checking fullScreenEnabled. */\n' );
document.write( '.video-js:-moz-full-screen {\n' );
document.write( '  position: absolute;\n' );
document.write( '}\n' );
document.write( '/* Fullscreen Styles */\n' );
document.write( 'body.vjs-full-window {\n' );
document.write( '  padding: 0;\n' );
document.write( '  margin: 0;\n' );
document.write( '  height: 100%;\n' );
document.write( '  /* Fix for IE6 full-window. https://www.cssplay.co.uk/layouts/fixed.html */\n' );
document.write( '  overflow-y: auto;\n' );
document.write( '}\n' );
document.write( '.video-js.vjs-fullscreen {\n' );
document.write( '  position: fixed;\n' );
document.write( '  overflow: hidden;\n' );
document.write( '  z-index: 1000;\n' );
document.write( '  left: 0;\n' );
document.write( '  top: 0;\n' );
document.write( '  bottom: 0;\n' );
document.write( '  right: 0;\n' );
document.write( '  width: 100% !important;\n' );
document.write( '  height: 100% !important;\n' );
document.write( '  /* IE6 full-window (underscore hack) */\n' );
document.write( '  _position: absolute;\n' );
document.write( '}\n' );
document.write( '.video-js:-webkit-full-screen {\n' );
document.write( '  width: 100% !important;\n' );
document.write( '  height: 100% !important;\n' );
document.write( '}\n' );
document.write( '.video-js.vjs-fullscreen.vjs-user-inactive {\n' );
document.write( '  cursor: none;\n' );
document.write( '}\n' );
document.write( '/* Poster Styles */\n' );
document.write( '.vjs-poster {\n' );
document.write( '  background-repeat: no-repeat;\n' );
document.write( '  background-position: 50% 50%;\n' );
document.write( '  background-size: contain;\n' );
document.write( '  cursor: pointer;\n' );
document.write( '  height: 100%;\n' );
document.write( '  margin: 0;\n' );
document.write( '  padding: 0;\n' );
document.write( '  position: relative;\n' );
document.write( '  width: 100%;\n' );
document.write( '}\n' );
document.write( '.vjs-poster img {\n' );
document.write( '  display: block;\n' );
document.write( '  margin: 0 auto;\n' );
document.write( '  max-height: 100%;\n' );
document.write( '  padding: 0;\n' );
document.write( '  width: 100%;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '/* Hide the poster when native controls are used otherwise it covers them */\n' );
document.write( '.video-js.vjs-using-native-controls .vjs-poster {\n' );
document.write( '  display: none;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '/* Text Track Styles */\n' );
document.write( '/* Overall track holder for both captions and subtitles */\n' );
document.write( '.video-js .vjs-text-track-display {\n' );
document.write( '    text-align: center;\n' );
document.write( '    position: absolute;\n' );
document.write( '    bottom: 45px;\n' );
document.write( '    left: 0;\n' );
document.write( '    right: 0;\n' );
document.write( '    /* transition */\n' );
document.write( '    -webkit-transition: all 0.4s;\n' );
document.write( '    -moz-transition: all 0.4s;\n' );
document.write( '    -o-transition: all 0.4s;\n' );
document.write( '    transition: all 0.4s;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '.video-js.vjs-user-inactive .vjs-text-track-display {\n' );
document.write( '    bottom: 5px;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '/* Individual tracks */\n' );
document.write( '.video-js .vjs-text-track {\n' );
document.write( '    display: none;\n' );
document.write( '    text-align: center;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '.video-js .vjs-subtitles {\n' );
document.write( '    color: #ffffff /* Subtitles are white */;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '.video-js .vjs-captions {\n' );
document.write( '    color: #ffcc66 /* Captions are yellow */;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '.vjs-tt-cue {\n' );
document.write( '    display: block;\n' );
document.write( '    width: auto;\n' );
document.write( '    display: inline-block;\n' );
document.write( '    padding: 3px 5px;\n' );
document.write( '    /* Transparent black background, or fallback to all black (oldIE) */\n' );
document.write( '    /* background-color-with-alpha */\n' );
document.write( '    background-color: #000000;\n' );
document.write( '    background-color: rgba(0, 0, 0, 0.5);\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '.vjs-lock-showing {\n' );
document.write( '    display: block !important;\n' );
document.write( '    opacity: 1;\n' );
document.write( '    visibility: visible;\n' );
document.write( '}\n' );
document.write( '\n' );
document.write( '&lt;/style&gt;' );
